import React from 'react';

import classes from './addressForm.module.css';

function AddressForm(props){
    return(
        <form>
            <div>
                <p>CONTACT DETAILS</p>
                <input type= "text" placeholder='Name*'></input>
                <input type= "text" placeholder='Mobile No*'></input>
            </div>
        </form>
    );
}

export default AddressForm;
